create table specification_values
(
    id                          int unsigned auto_increment comment '规格值ID'
        primary key,
    source_id                   int unsigned default 0                 not null comment '该项数据的拷贝来源，店铺的商品数据为同类平台数据的部分拷贝',
    value_code                  char(36)                               not null comment '规格值唯一标识',
    product_id                  int unsigned                           not null comment '商品ID',
    specification_property_id   int unsigned                           not null comment '规格项ID',
    specification_property_name varchar(32)                            not null comment '规格项名称',
    value                       varchar(32)                            not null comment '规格值内容',
    display_order               int unsigned                           not null comment '排序（顺序）',
    created_at                  datetime     default CURRENT_TIMESTAMP not null,
    updated_at                  datetime                               null,
    deleted_at                  datetime                               null
)
    collate = utf8mb4_unicode_ci;

create index specification_values_source_id_index
    on specification_values (source_id);

create index specification_values_specification_property_id_index
    on specification_values (specification_property_id);

create index specification_values_value_code_index
    on specification_values (value_code);

